TIMELIB_ZONETYPE_ID 		= 1;
TIMELIB_ZONETYPE_OFFSET 	= 2;
TIMELIB_ZONETYPE_ABBR 		= 3;

function get_time_zone_info( sTimezoneID )
	if not timezonedb[ sTimezoneID ] then
		error( "Timezone ID '" + sTimezoneID + "' is invalid", 2 );
	end
	
	return
	{
		ts				= timezonedb[ sTimezoneID ][ 'ts' ];
		abbr			= timezonedb[ sTimezoneID ][ 'abbr' ];
		offset			= timezonedb[ sTimezoneID ][ 'offset' ];
		timezone_id		= timezonedb[ sTimezoneID ][ 'timezone_id' ];
	};
end